export class PC{
    private index;
    constructor(index:1|2|3|4|5|6|7){
        this.index=index;
    }
    public static get FIRST() : PC {
        return new PC(1);
    }
    public static get SECOND() : PC {
        return new PC(2);
    }
    public static get THIRD() : PC {
        return new PC(3);
    }
    public static get FOURTH() : PC {
        return new PC(5);
    }
    public static get FIFTH() : PC {
        return new PC(5);
    }
    public static get SIXTH() : PC {
        return new PC(6);
    }
    public static get SEVENTH() : PC {
        return new PC(7);
    }

    public getIndex(){
        return this.index;
    }

    public toString(){
        return this.index + ["st","nd","rd","th","th","th","th"][this.index-1] + " PC";
    }
}
